import React from 'react';

export default class Contact extends React.Component{

    render(){

        return(
            <div style={decor.big}>
            <div style={{...decor.border, ...decor.title}}>
            <p style={decor.add}>Contact Us</p> 
            <p>chose category or create a new one</p>
            </div>
            <div style={{...decor.grid, ...decor.borderTwo}}>
            <div>
                <p>Adress</p>
                <p>Phone</p>
                <p>e-mail</p>
            </div>
                <p>Street....</p>
                <p>+34 7325743482</p>
                <p>contact@conception.com</p>
            </div>
        </div>
        )
    }
}
const decor={
    big:{
        width: '70%',
        margin: 'auto',
        paddingTop: '1em',
        paddingBottom: '2em'
    },
    border:{
        borderBottom: '2px solid rgb(42, 43, 45)',
        padding: '1em',
    },
    borderTwo: {
        borderBottom: '2px solid rgb(42, 43, 45)',
        padding: '1em',
        paddingBottom: '4em'
    },
    add: {
        fontSize: '30px'
    },
    title: {
        textTransform: 'uppercase',
        textAlign: 'center',
        fontSize: '20px'
    },
    grid:{
        display: 'grid',
        gridTemplateColumns: 'repeat(2, 1fr)',
        // margin: 'auto',
        gridGap: '3em'
    },
    input:{
        marginTop: '40px',
        // width:'200px',
        width: '300px',
        outline: 'none',
        borderTop:'none',
        borderRight:'none',
        borderLeft: 'none',
        fontFamily:"'EB Garamond', serif",
        fontSize: '20px',
    },
    button:{
            backgroundColor: 'rgb(26, 27, 28)',
            color: 'white',
            fontSize: '13px',
            textTransform: 'uppercase',
            border: '2px solid rgb(26, 27, 28)',
            position: 'relative',
            textAlign: 'center',
            height: '40px',
            width: '300px',
            outline: 'none',
            marginTop: '40px',
            fontFamily:"'EB Garamond', serif",
    },
    icon: {
        border: '1px solid black',
        height: '40px',
        width: '40px',
        marginTop: '0px',
        marginLeft: '10px',
    },
}
